import React, { Component } from 'react';
import Particles from 'react-particles-js';
import './App.css';
import { Test } from './components/test/';
import Homepage from "./components/Homepage/";
import {TweenMax, Power2, TimelineMax, Back} from "gsap/TweenMax";

import { Route, BrowserRouter, Redirect, Switch } from "react-router-dom";
import Snap from 'snapsvg-cjs';
import * as d3 from "d3";

class App extends Component {
  render() {
    var s = Snap($(".canvas")[0]);

    var g = s.paper.g();

    Snap.load("https://teespring-art-noun.s3.amazonaws.com/12341.svg", onLoadSvg);

    function onLoadSvg(doc) {
        g.add( doc );
        g.add( s.paper.text(200, 200, "Hello World") );
    }
    return  <svg class="canvas"></svg>
  }
}

export default App;
